import React, { useState } from 'react';

import axios from 'axios'

import { Container, FormContainer, RegisterForm } from './styles';
import FormGroup from '../../Components/Form-Group'


function Cadastro() {

  const inputData = {
    name: null,
    login: null,
    password: null
  }

  const [data, setData] = useState(inputData)

  console.log(data)


  function register() {
    axios.post('http://localhost:5000/users')
  }

  return (
    <Container>
        <FormContainer>
            <RegisterForm>
                <FormGroup data={data} setValueFunction={setData} name="name" label="Nome" type="text" placeholder="Nome" id="register-name" /> 
                <FormGroup setValueFunction={setData} name="login" label="Login" type="text" placeholder="Login" id="register-login" /> 
                <FormGroup setValueFunction={setData} name="password" label="Senha" type="password" placeholder="Senha" id="register-password" />
                <button type="button" onClick={register}>Cadastrar</button>
            </RegisterForm>
            <a href="#">JÃ¡ tem uma conta? Entre</a>
        </FormContainer>
    </Container>
  )
}

export default Cadastro;
